from tkinter.font import BOLD
import PySimpleGUI as sg
import random

#todo: correct keyboard, not in words list, multilingual version, javascript version (web app)
sg.theme('Default1')
sg.theme_button_color(('black', '#fdfefe'))

go=b''
changeword=b''
again=b''
changelang=b''
exitb=b''

def start(file):
    result = chooseresult(file)
    chars=['','','','','','']
    row = 0
    return result, chars, row


#main function of game and layout
def main():
    file = selectlang()
    result, chars, row = start(file)
    COL=5
    ROWS=6
    topRow = 'QWERTZUIOP'
    midRow = 'ASDFGHJKL'
    bottomRow = 'YXCVBNM'
    layout =[[[sg.Button(chars[i], size=(4, 1), key=(i,j), pad=(0,0), button_color=('white'), font=('helvetca', 15, BOLD)) for j in range(COL)] for i in range(ROWS)],
                [sg.Sizer(0,5)],
                [sg.Txt('Insert Word')],
                [sg.In(size=(15,1), key='IN', do_not_clear=False, focus=True, font=('helvetica', 15))],
                [sg.Button('', image_data=go, image_subsample=15, bind_return_key=True, key='GO!'), sg.Button('', image_data=changeword, image_subsample=15, key=('NW')), sg.Button('', image_data=exitb, image_subsample=15, key='Exit')],
                [sg.Text(' ' * 4)] + [sg.Button(c, key=c, size=(2, 1)) for c in topRow] + [sg.Stretch()],
                [sg.Text(' ' * 11)] + [sg.Button(c, key=c, size=(2, 1)) for c in midRow] + [sg.Stretch()],
                [sg.Text(' ' * 18)] + [sg.Button(c, key=c, size=(2, 1)) for c in bottomRow] + [sg.Stretch()],
                [sg.Button('', image_data=changelang, image_subsample=15, bind_return_key=True, key='cln')]]
    
    win = sg.Window('Wannabe Wordle', layout, element_justification='c')
    while True:             # Event Loop
        event, values = win.read()
        if event in (None, 'Exit'):
            win.close
            break
        if event == 'NW':
            result, chars, row = start(file)
            for i in range(ROWS): 
                for j in range(COL):
                    win[i,j].update(chars[i], button_color=('White'))
            for c in topRow:
                win[c].update(button_color=sg.theme_button_color())
            for c in midRow:
                win[c].update(button_color=sg.theme_button_color())
            for c in bottomRow:
                win[c].update(button_color=sg.theme_button_color())
        if event == 'GO!':
            if len(values['IN']) == 5:    
                userinput = values['IN']
                chars = list(userinput)
                chars = list(map(lambda x: x.upper(), chars))
                for i in range(5):
                    win[row,i].update(chars[i])
                row, chars, result, new_game = fitchars(win, row,chars,result,file)
                if new_game:
                    for i in range(ROWS): 
                        for j in range(COL):
                            win[i,j].update(chars[i], button_color=('White'))
                    for c in topRow:
                        win[c].update(button_color=sg.theme_button_color())
                    for c in midRow:
                        win[c].update(button_color=sg.theme_button_color())
                    for c in bottomRow:
                        win[c].update(button_color=sg.theme_button_color())
            else: 
                sg.popup('5 letters!')
        if event == sg.WIN_CLOSED:
            win.close()
            break
        if event == 'cln':
            main()

    win.close()

def selectlang():
    layout = [[sg.Text("Choose Language")],
         [sg.Combo(['Deutsch', 'English','Letzebuergesch', 'Francaise', 'Espagnol', 'Italiano', 'Svenska', 'Nederlands', 'Portogues', 'Norsk', 'Suomen kieli', 'Dansk', 'Latinus'], key='LANG'), sg.Button('', image_data=changelang, image_subsample=15, bind_return_key=True, key='cl')]]
    langwin = sg.Window("", layout, modal=True, element_justification='c')
    while True:
        event, values = langwin.read()
        if event == "Exit":
            langwin.close()
            win.close()
        if event == sg.WIN_CLOSED:
            langwin.close()
        if event == 'cl':
            if values['LANG'] == 'Deutsch':
                file = "lang/de.txt"
            if values['LANG'] == 'English':
                file = "lang/en.txt"
            if values['LANG'] == 'Letzebuergesch':
                file = "lang/lb.txt"
            if values['LANG'] == 'Francaise':
                file = "lang/fr.txt"
            if values['LANG'] == 'Espagnol':
                file = "lang/es.txt"
            if values['LANG'] == 'Italiano':
                file = "lang/it.txt"
            if values['LANG'] == 'Svenska':
                file = "lang/swe.txt"
            if values['LANG'] == 'Nederlands':
                file = "lang/nl.txt"
            if values['LANG'] == 'Portogues':
                file = "lang/pt.txt"
            if values['LANG'] == 'Norsk':
                file = "lang/no.txt"
            if values['LANG'] == 'Suomen kieli':
                file = "lang/fi.txt"
            if values['LANG'] == 'Dansk':
                file = "lang/dk.txt"
            if values['LANG'] == 'Latinus':
                file = "lang/lat.txt"
            langwin.close()
            return file

#select a random word as result from external list
def chooseresult(path):
    file = open(path, 'r')
    allText = file.read()
    file.close()
    words = list(map(str.upper, allText.split()))
    result = random.choice(words)
    return result

#search all indices of letter
def indlist(seq, letter):
    start_at = -1
    dups = []
    while True:
        try:
            dup = seq.index(letter,start_at+1)
        except ValueError:
            break
        else:
            dups.append(dup)
            start_at = dup
    return dups

#search for matching characters between input and result
#mark characters with specific colors
#win or loose message
def fitchars(win, row, chars, result, file):
    result2 = list(result)
    input = chars
    common = list(set(result2).intersection(input))
    for l in common:
        win[l].update(button_color=('lightgreen'))
    badchars = set(chars) - set(common)
    for b in badchars:
        win[b].update(button_color=('Grey'))
    for let in result2:
        dupsres = indlist(result2, let)
        if let in input:
            dupsinp = indlist(input, let)
            commoninds = list(set(dupsinp).intersection(dupsres))
            if len(commoninds) !=0:
                for ind in commoninds:
                    input[ind] = 0
                    result2[ind] = 0
                    win[row,ind].update(button_color=('green'))
                    #dupsres.remove(ind)
                    #dupsinp.remove(ind)
            counter=0
            for ix in dupsinp:
                if ix not in commoninds:
                    counter+=1
                    if counter <= (len(dupsres) - len(commoninds)):
                        win[row,ix].update(button_color=('yellow'))

    if result2 == chars:
        sg.popup('YAY, WIN!')
        new_game = open_window(win)
    elif row == 5 and result != chars:
        sg.popup(f'OH NO! It was: {result}')
        new_game = open_window(win)
    else: 
        row +=1
        new_game = False
    if new_game:
        result, chars, row = start(file)
    return row, chars, result, new_game

#choose if you want to play another round    
def open_window(win):
    layout = [[sg.Text("and now?")],
            [sg.Button('', image_data=again, image_subsample=15, bind_return_key=True, key="new"), sg.Button('', image_data=exitb, image_subsample=15, key='Exit')]]
    window = sg.Window("", layout, modal=True)
    while True:
        event, values = window.read()
        if event == "Exit":
            window.close()
            win.close()
            return False
        if event == sg.WIN_CLOSED:
            window.close()
            return False
        if event == 'new':
            window.close()
            return True

main()